import React from 'react';

import{add,sub,div,mult} from './Add';

function App(){
    return(
        <>
            <ui>
                <li>sum of two no is {add(50,3)}</li>
                <li>sub of two no is {sub(30,3)}</li>
                <li>div of two no is {div(70,3)}</li>
                <li>mult of two no is {mult(30,3)}</li>
            </ui>
        </>
    )
}

export default App;
